import Layout from '../components/Layout';

const Resume = () => (
  <Layout>
    <div>
      <h1>Resume</h1>
      <p>Coming Soon</p>
    </div>
    <div>
    <Image
        alt="resume-page-2"
        src="/resume-.png"
        layout="intrinsic"
        width={512}
        height={512}
        />
    </div>
  </Layout>
  );

  export default Resume;
